    "2014-11-28T18:16:23.610476",nt"name": "perishable-agricultural-commodities-act-search-engine",nt"isopen":
    true,nt"url": null,nt"notes": "The Perishable Agricultural Commodities
    Act (PACA) was enacted at the request of the fruit and vegetable industry to promote
    fair trade in the industry. The PACA protects businesses dealing in fresh and frozen
    fruits and vegetables by establishing and enforcing a code of fair business practices
    and by helping companies resolve business disputes.rn rnThe PACA Branch is responsible
    for administering the PACA and offers many services to the industry. PACA Branch
    experts receive hundreds of telephone calls each week from companies requesting
    assistance on problems unique to the industry such as interpretation of inspection
    certificates, advice on contract disputes, and bankruptcy payments.rnrnThe PACA
    Search Engine is an online tool that allows the public to determine if a business
    is licensed under the PACA, users can also see companies trade name(s), branch location(s),
    principal(s), and other related license information.",nt"license_title": "Creative
